// import React from 'react';
import React, { useState } from 'react';

import './App.css';




function CounterComponent() {
  const [count1, setCount1] = useState(0);
  const [count2, setCount2] = useState(0);

  return (
    <>
    <button onClick = {() => setCount1(count1 + 1)}>
      btn
    </button>
    <p>counter: {count1}</p>
    <button onClick = {() => setCount2(count2 + 1)}>
      btn
    </button>
    <p>counter: {count2}</p>
      </>
  )
}


const obj: {name:string; year:string} = {
  name:'Lesson',
  year:'2025',
}

function Inner(props: { year: string} ) {
  return (
    <div>
      <h2>date start {props.year}</h2>
    </div>
  )
}

function Test(props: { name: string; year: string}) {
  return (
    <div>
      <h1>start project {props.name}</h1>
      <Inner year = {props.year}/>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Test {...obj}/>
      <CounterComponent/>
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
          Edit <code>src/App.js</code> HELLO
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;

